    "Мы берем на себя все сложности таможенного оформления. Благодаря многолетнему опыту и глубоким знаниям таможенного законодательства, мы обеспечиваем беспроблемный проход ваших грузов через таможню. Подготовка и подача всех необходимых документов, включая декларации, сертификаты и лицензии, – это наша повседневная работа." => "We take care of all the complexities of customs clearance. Thanks to many years of experience and deep knowledge of customs legislation, we ensure smooth passage of your goods through customs. Preparation and submission of all necessary documents, including declarations, certificates and licenses, is our daily work.",
    "Свяжитесь с нами" => "Contact us",
    "Наш опыт в области авиаперевозок и многолетнее сотрудничество с передовыми авиакомпаниями дает вам возможность получить быструю и безопасную" => "Our experience in the field of air transportation and many years of cooperation with leading airlines gives you the opportunity to receive fast and safe",
    "доставку вашего груза практически в любой аэропорт мира. Мы берем на себя задачу доставки вашего срочного груза." => "delivery of your cargo to almost any airport in the world. We take on the task of delivering your urgent cargo.",
    "Связаться с нами" => "Connect with us",
    "Автомобильная перевозка" => "Road transportation",
    "Железно-дорожная перевозка" => "Rail transportation",
    "Полноценный сервис" => "Full service",
