    "Taklog Logistics — ваш надежный партнер для быстрых и качественных перевозок грузов в любую точку мира. Мы предлагаем полный спектр услуг, ориентированных на ваши потребности." => "Taklog Logistics is your reliable partner for fast and high-quality cargo transportation anywhere in the world. We offer a full range of services tailored to your needs.",
    "Географический охват" => "Geographical coverage",
    "Страны Евросоюза, Турция" => "EU countries, Türkiye",
    "100% доверие" => "100% trust",
    "Мы верим в силу партнерства и стремимся к совместному процветанию" => "We believe in the power of partnership and strive for shared prosperity",
    "24/7 Поддержка" => "24/7 Support",
    "Оперативность превыше всего: ответ в кратчайшие сроки." => "Efficiency is paramount: response as soon as possible.",
    "Гибкость" => "Flexibility",
    "Мы подходим к каждому клиенту индивидуально, независимо от его размера и специфики бизнеса." => "We approach each client individually, regardless of its size and business specifics.",
    "О компании Taklog" => "About Taklog",
    "О компании" => "About company",
    "Заказать услугу" => "Order service",
    "Будьте впереди с " => "Stay ahead with ",
    "Мы специализируемся на решении сложных логистических задач, требующих нестандартных подходов. Наш опыт работы в различных регионах и отраслях позволяет нам успешно организовывать тяжелые перевозки, осуществлять промышленный переезд и управлять крупномасштабными мероприятиями." => "We specialize in solving complex logistics problems that require non-standard approaches. Our experience across multiple geographies and industries allows us to successfully handle heavy haulage, industrial relocations and large scale event management.",
    "Тaklog Logistics зарекомендовала себя как надежный партнер для бизнеса любого масштаба. Наши услуги пользуются высоким спросом как у небольших компаний, так и у крупных корпораций, представленных в рейтинге Fortune 500." => "Taklog Logistics has established itself as a reliable partner for businesses of any size. Our services are in high demand from both small companies and large Fortune 500 corporations.",
    "Мы предлагаем комплексный подход к управлению цепочками поставок. Станьте нашим партнером и получите доступ к широкому спектру услуг, направленных на снижение затрат, ускорение доставки и повышение качества обслуживания." => "We offer an integrated approach to supply chain management. Become our partner and gain access to a wide range of services aimed at reducing costs, speeding up delivery and improving quality of service.",
