    "Команда, которой можно восхищаться" => "A team to admire",
    "Объединенные общей целью, наши высококвалифицированные специалисты с глубокими знаниями в области логистики успешно решают самые сложные задачи. Благодаря слаженной работе команды мы достигаем выдающихся результатов и пользуемся заслуженной репутацией на рынке." => "United by a common goal, our highly qualified specialists with deep knowledge in the field of logistics successfully solve the most complex problems. Thanks to the well-coordinated work of the team, we achieve outstanding results and enjoy a well-deserved reputation in the market.",
