    "Компания TAKLOG оказывает полную поддержку нашим клиентам, от отправки до таможенного оформления и заполнения сопроводительной документации вашего груза — TAKLOG предлагает полный пакет услуг." => "TAKLOG provides full support to our clients, from shipping to customs clearance and filling out the accompanying documentation of your cargo - TAKLOG offers a complete package of services.",
